(191, 1, '2016-06-02 01:27:05', '2016-06-02 01:27:05', '<p>Медиа Холдинг Вести Украина - динамично развивающийся современный мультимедиа холдинг, включающий в себя печатные, телевизионные, радио и Internet-ресурсы. Благодаря качеству и актуальности контента, остроте тем и оперативности подачи информации, медиапродукты Холдинга занимают лидирующие позиции в своих сегментах. Профессиональная, креативная команда и постоянный мониторинг мировых инноваций и медиа-трендов - ключевой принцип успеха Холдинга на рынке.</p> \r\n\r\n<p>В состав Медиа Холдинга входят: Газета Вести, Радио Вести, телеканал UBR, Internet Sales House Digital Decisions, сайты vesti-ukr.com и ubr.ua</p>', 'О нас', '', 'publish', 'open', 'open', '', 'about-us', '', '', '2016-06-01 19:57:05', '2016-06-01 19:57:05', '', 0, 'http://vestiukraine/?p=191', 0, 'post', '', 0),
(192, 1, '2016-06-01 19:57:05', '2016-06-01 19:57:05', '<p>Медиа Холдинг Вести Украина - динамично развивающийся современный мультимедиа холдинг, включающий в себя печатные, телевизионные, радио и Internet-ресурсы. Благодаря качеству и актуальности контента, остроте тем и оперативности подачи информации, медиапродукты Холдинга занимают лидирующие позиции в своих сегментах. Профессиональная, креативная команда и постоянный мониторинг мировых инноваций и медиа-трендов - ключевой принцип успеха Холдинга на рынке.</p> \r\n\r\n<p>В состав Медиа Холдинга входят: Газета Вести, Радио Вести, телеканал UBR, Internet Sales House Digital Decisions, сайты vesti-ukr.com и ubr.ua</p>', 'О нас', '', 'inherit', 'closed', 'closed', '', '191-revision-v1', '', '', '2016-06-01 19:57:05', '2016-06-01 19:57:05', '', 191, 'http://vestiukraine/%d0%b1%d0%b5%d0%b7-%d0%ba%d0%b0%d1%82%d0%b5%d0%b3%d0%be%d1%80%d0%b8%d0%b8/191-revision-v1/', 0, 'revision', '', 0),
(193, 1, '2016-06-01 21:49:00', '2016-06-01 21:49:00', '<h1>Миссия Медиа Холдинга</h1>\r\nЯвляясь частью общества, мы помогаем людям быть в курсе событий, делать выбор, принимать решения, видеть, слышать и чувствовать друг друга, а поддержка общества гарантирует нам коммерческий успех.\r\n\r\n<h1>Видение Медиа Холдинга</h1>\r\nПервый мультимедийный национальный холдинг Украины, создающий тренды, ценности и смыслы, за которые люди готовы платить.', 'Миссия и ценности', '', 'publish', 'open', 'open', '', 'mission-and-values', '', '', '2016-06-01 21:49:00', '2016-06-01 21:49:00', '', 0, 'http://vestiukraine/?p=193', 0, 'post', '', 0),
(194, 1, '2016-06-01 21:49:00', '2016-06-01 21:49:00', '<h1>Миссия Медиа Холдинга</h1>\r\nЯвляясь частью общества, мы помогаем людям быть в курсе событий, делать выбор, принимать решения, видеть, слышать и чувствовать друг друга, а поддержка общества гарантирует нам коммерческий успех.\r\n\r\n<h1>Видение Медиа Холдинга</h1>\r\nПервый мультимедийный национальный холдинг Украины, создающий тренды, ценности и смыслы, за которые люди готовы платить.', 'Миссия и ценности', '', 'inherit', 'closed', 'closed', '', '193-revision-v1', '', '', '2016-06-01 21:49:00', '2016-06-01 21:49:00', '', 193, 'http://vestiukraine/%d0%b1%d0%b5%d0%b7-%d0%ba%d0%b0%d1%82%d0%b5%d0%b3%d0%be%d1%80%d0%b8%d0%b8/193-revision-v1/', 0, 'revision', '', 0),
(195, 1, '2016-06-01 22:00:45', '2016-06-01 22:00:45', 'Стратегическое и оперативное управление Медиа Холдингом Вести Украина осуществляет Совет Директоров - коллегиальный исполнительный орган, обладающий полномочиями для управления всеми активами Холдинга. Возглавляет Совет Директоров Ольга Семченко, украинский медиа-менеджер и эксперт в сфере стратегических коммуникаций.', 'Структура', '', 'publish', 'open', 'open', '', 'structure', '', '', '2016-06-01 22:00:45', '2016-06-01 22:00:45', '', 0, 'http://vestiukraine/?p=195', 0, 'post', '', 0),
(196, 1, '2016-06-01 22:00:45', '2016-06-01 22:00:45', 'Стратегическое и оперативное управление Медиа Холдингом Вести Украина осуществляет Совет Директоров - коллегиальный исполнительный орган, обладающий полномочиями для управления всеми активами Холдинга. Возглавляет Совет Директоров Ольга Семченко, украинский медиа-менеджер и эксперт в сфере стратегических коммуникаций.', 'Структура', '', 'inherit', 'closed', 'closed', '', '195-revision-v1', '', '', '2016-06-01 22:00:45', '2016-06-01 22:00:45', '', 195, 'http://vestiukraine/%d0%b1%d0%b5%d0%b7-%d0%ba%d0%b0%d1%82%d0%b5%d0%b3%d0%be%d1%80%d0%b8%d0%b8/195-revision-v1/', 0, 'revision', '', 0),
(197, 1, '2016-06-01 22:02:04', '2016-06-01 22:02:04', '<p>История Медиа Холдинга Вести Украина началась с идеи создать уникальный для украинского рынка продукт - качественную бесплатную ежедневную газету. Бесплатная пресса пользуется популярностью и доверием во многих странах мира. Примером послужил успех таких изданий как Metro International, Evening Standart, 20 Minutos. Для газеты был выбран специальный формат создания материалов в краткой, аналитичной и доступной форме для наиболее удобного и оперативного чтения.</p> \r\n\r\n<p>Одновременно с Газетой Вести был запущен сайт vesti-ukr.com.</p>\r\n\r\n<p>В июле был приобретен телеканал UBR, а 30 августа увидел свет первый номер журнала "Вести.Репортер".</p>', 'История', '', 'publish', 'open', 'open', '', 'history', '', '', '2016-06-01 22:02:04', '2016-06-01 22:02:04', '', 0, 'http://vestiukraine/?p=197', 0, 'post', '', 0),
